                Qe = "\u0627\u0644\u0627\u062a\u0635\u0627\u0644", Re = "\u0643\u0644\u0645\u0629 \u0627\u0644\u0633\u0631 \u0627\u0644\u062e\u0627\u0635\u0629 \u0628\u0643 \u0645\u0646 \u062c\u0647\u0627\u0632 \u0628\u0633\u064a\u0637 \u062c\u062f\u0627\u060c \u064a\u0631\u062c\u0649 \u062a\u0639\u062f\u064a\u0644 \u0643\u0644\u0645\u0629 \u0627\u0644\u0645\u0631\u0648\u0631. \u064a\u062c\u0628 \u0627\u0644\u0645\u0631\u0648\u0631 \u0627\u0644\u062c\u062f\u064a\u062f\u0629 \u0644\u0646 \u062a\u0643\u0648\u0646 \u0623\u0642\u0644 \u0645\u0646 \u0633\u062a\u0629 \u0623\u062d\u0631\u0641",
                Kd = "\u0644\u0627 \u064a\u0632\u0627\u0644 \u063a\u064a\u0631 \u062c\u0647\u0627\u0632\u0643 \u0645\u062a\u0635\u0644\u0627 \u0648\u0627\u064a \u0641\u0627\u064a \u0627\u0644\u062e\u0627\u0635 \u0628\u0643\u060c \u064a\u0631\u062c\u0649 \u062a\u0643\u0648\u064a\u0646 \u062e\u062f\u0645\u0629 \u0627\u0644\u0648\u0627\u064a \u0641\u0627\u064a \u0627\u0644\u062e\u0627\u0635 \u0628\u0643.", Se = "\u0641\u0625\u0646 \u0627\u0644\u062e\u0637\u0648\u0629 \u0627\u0644\u0623\u0648\u0644\u0649 \u062a\u0643\u0648\u0646 \u0648\u0627\u062d\u062f\u0629 \u0645\u0646 \u0646\u0647\u0627\u064a\u0629 \u0643\u0628\u0644 \u0627\u0644\u0634\u0628\u0643\u0629 \u0644\u0644\u0627\u062a\u0635\u0627\u0644 \u062c\u0647\u0627\u0632 \u0627\u0644\u062a\u0648\u062c\u064a\u0647 \u0627\u0644\u062e\u0627\u0635 \u0628\u0643 \u0648\u0639\u0644\u0649 \u0627\u0644\u0637\u0631\u0641 \u0627\u0644\u0622\u062e\u0631 \u0645\u0646 \u0627\u0644\u0648\u0635\u0648\u0644 \u0639\u0628\u0631 \u0645\u0646\u0641\u0630 \u0625\u064a\u062b\u0631\u0646\u062a \u0627\u0644\u0643\u0627\u0645\u064a\u0631\u0627",
