                lg = "\u041e\u0442\u043a\u043b\u044e\u0447\u0438\u0442\u044c \u0442\u0440\u0435\u0432\u043e\u0433\u0443?", mg = "\u041f\u0435\u0440\u0435\u0437\u0430\u043f\u0443\u0441\u043a \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430, \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044e\u0442?", ng = "\u0412\u0430\u0440\u0438\u0430\u043d\u0442 \u0440\u0430\u0441\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u0437\u0430\u043f\u0438\u0441\u0438 \u21161", og = "\u0412\u0430\u0440\u0438\u0430\u043d\u0442 \u0440\u0430\u0441\u043f\u0438\u0441\u0430\u043d\u0438\u0435 \u0437\u0430\u043f\u0438\u0441\u0438 \u21162",
